import React from "react";
import { useParams } from "react-router-dom";

function TentPage(props) {
  const tents = props.tents;
  //console.log(tents);
  const { id, name } = useParams();
  //console.log(id + ", " + name);
  return (
    <div className="container">
      <div className="row">
        {
          tents.map((tent, i)=>(
            <div className="col-md-4">
              <h4>{tent.title}</h4>
              <p>{tent.content}</p>
            </div>
          ))
        }
      </div>
    </div>
  );
  
}

export default TentPage;
